import '../stylesheets/UserList.scss';
import UserItems from './UserItems';

const UserList = (props) => {
  const x = props.datas.map((eachItem) => {
    return <UserItems datitos={eachItem} />;
  });

  return <ul>{x}</ul>;
};

export default UserList;
